import React from 'react';

import {Icon , Input} from '../Atom';



function MoleculeInput(props) {
    //const className = ['default-input'];
    
    return (
        <><Input
            placeholder={props.placeholder}
            type={props.type}
            onChange={(e) => props.changeInput(e, 'ooofff')}
            value={props.value}
            isValid={props.isValid}
            isInvalid={props.isInvalid}
            className={props.className} />
            <Icon 
                icon='key'
                className='small-icon red ml-2 input-icons'
            
            />
            
            </>

   
      
    );
};

export default MoleculeInput;
